import React, { useState } from "react";

function Navbar() {
  const [showLinks, setShowLinks] = useState(false);

  const toggleLinks = () => {
    setShowLinks(!showLinks);
  };

  return (
    <nav style={{ position: "fixed", top: 0, left: 0, width: "100%", backgroundColor: "#222", color: "#fff" }}>
        <div className="nav-header">
          <button className="toggle-btn" onClick={toggleLinks}>
            <i className={showLinks ? "fas fa-times" : "fas fa-bars"}></i>
          </button>
        </div>
        <div className={`nav-links ${showLinks ? "show-links" : ""}`}>
          <ul>
            <li>
              <a href="/">Home</a>
            </li>
            <li>
              <a href="/about">About</a>
            </li>
            <li>
              <a href="/contact">Contact</a>
            </li>
          </ul>
        </div>
    </nav>
  );
}

export default Navbar;
